  | "grammar" -> T_GRAMMAR
  | "options" -> T_OPTIONS
  | "fragment" -> T_FRAGMENT
  | "skip" | "more" | "popMode" -> T_COMMAND 
  | s when System.Char.IsUpper s.[0]-> TERMINAL(lexeme)
  | s (*when System.Char.IsLower s.[0]*)-> IDENTIFIER(lexeme)


